const Footer = () => {
    return(
        <div>
            <div className= "footer-box">
                <div className = "quick-links">
                Quick Links
                </div>
                <div className = "service-links">
                Services
                </div>
                <div className = "contact">
                Contact
                </div>
            </div>
    <style jsx>{`
    
    .footer-box {
        position: absolute;
        width: 1344px;
        height: 434px;
        left: 0px;
        top: 5415px;
        background: #000000;
    }

    .quick-links {
        position: absolute;
        width: 125px;
        height: 28px;
        left: 54px;
        top: 5488px;
        font-family: Roboto;
        font-style: normal;
        font-weight: 500;
        font-size: 24px;
        line-height: 28px;
        color: #FFFFFF;
    }

    .service-links {
        position: absolute;
        width: 125px;
        height: 28px;
        left: 366px;
        top: 5488px;
        font-family: Roboto;
        font-style: normal;
        font-weight: 500;
        font-size: 24px;
        line-height: 28px;
        color: #FFFFFF;
    }

    .contact {
        position: absolute;
        width: 125px;
        height: 28px;
        left: 1004px;
        top: 5488px;
        font-family: Roboto;
        font-style: normal;
        font-weight: 500;
        font-size: 24px;
        line-height: 28px;
        color: #FFFFFF;
    }
    `}</style>
        </div>
    )
}

export default Footer
